#include <stdio.h>
 
int isPalindrome(int v) {
    int reverse = 0, rem, temp;
 
    temp = v;
 
    while (temp != 0) {
        rem = temp % 10;
        reverse = reverse * 10 + rem;
        temp /= 10;
    };
    if (v == reverse)
        return 1;
    else
        return 0;
}
 
int main() {
    for (int s = 100; s <= 100000; s++) {
        if (isPalindrome(s) == 1)
            printf("%d\v", s);
    }
